type APIService interface {
	// 用户接口
	Register(ctx context.Context, req *RegisterRequest) (r *RegisterResponse, err error)

	Login(ctx context.Context, req *LoginRequest) (r *LoginResponse, err error)

	GetProfile(ctx context.Context) (r *GetProfileResponse, err error)

	UpdateProfile(ctx context.Context, req *UpdateProfileRequest) (r *UpdateProfileResponse, err error)

	ChangePassword(ctx context.Context, req *ChangePasswordRequest) (r *ChangePasswordResponse, err error)

	UploadResume(ctx context.Context, req *UploadResumeRequest) (r *UploadResumeResponse, err error)

	GetResume(ctx context.Context) (r *GetResumeResponse, err error)
	// 面试接口
	StartInterview(ctx context.Context, req *StartInterviewRequest) (r *StartInterviewResponse, err error)

	SubmitAnswer(ctx context.Context, req *SubmitAnswerRequest, interviewID int64) (r *SubmitAnswerResponse, err error)

	FinishInterview(ctx context.Context, interviewID int64) (r *FinishInterviewResponse, err error)

	GetInterviewDetail(ctx context.Context, interviewID int64) (r *GetInterviewDetailResponse, err error)

	GetInterviewHistory(ctx context.Context, req *GetInterviewHistoryRequest) (r *GetInterviewHistoryResponse, err error)

	AnalyzeResume(ctx context.Context, req *AnalyzeResumeRequest) (r *AnalyzeResumeResponse, err error)

	GetAbilityAnalysis(ctx context.Context) (r *GetAbilityAnalysisResponse, err error)
	// 题库接口
	GetCategories(ctx context.Context) (r *GetCategoriesResponse, err error)

	GetQuestionList(ctx context.Context, req *GetQuestionListRequest) (r *GetQuestionListResponse, err error)

	GetQuestionDetail(ctx context.Context, questionID int64) (r *GetQuestionDetailResponse, err error)

	FavoriteQuestion(ctx context.Context, req *FavoriteQuestionRequest) (r *FavoriteQuestionResponse, err error)

	UnfavoriteQuestion(ctx context.Context, questionID int64) (r *FavoriteQuestionResponse, err error)

	GetFavoriteQuestions(ctx context.Context, req *GetFavoriteQuestionsRequest) (r *GetFavoriteQuestionsResponse, err error)
	// 文件接口
	GetUploadUrl(ctx context.Context, req *GetUploadUrlRequest) (r *GetUploadUrlResponse, err error)

	ConfirmUpload(ctx context.Context, req *ConfirmUploadRequest) (r *ConfirmUploadResponse, err error)
}

